import React from "react";
import { Card } from "antd";

const OrderBook = () => {
	return (
		<div className="">
			<Card className="orderBook">
				<table style={{ width: "100%" }}>
					<tr>
						<th>Firstname</th>
						<th>Lastname</th>
						<th>Age</th>
					</tr>
					<tr>
						<td>Jill</td>
						<td>Smith</td>
						<td>50</td>
					</tr>
					<tr>
						<td>Eve</td>
						<td>Jackson</td>
						<td>94</td>
					</tr>
				</table>
			</Card>
		</div>
	);
};

export default OrderBook;
